import { useForm, SubmitHandler } from 'react-hook-form';
import { ILoginParams } from '../../../models/auth';

const onSubmit: SubmitHandler<ILoginParams> = (data) => console.log(data);
export default function LoginFormV2() {
  const {
    register,
    formState: { errors },
    handleSubmit,
  } = useForm<ILoginParams>();

  return (
    <form onSubmit={handleSubmit(onSubmit)}>
      <input {...register('email', { required: 'Vui long nhap email' })} />
      {errors.email && 'First name is required'}
      <input {...register('password', { maxLength: { value: 4, message: 'error message' } })} />
      {errors.password && 'Last name is required'}
      {/* <input type="chechbox" /> */}
      <input type="submit" />
    </form>
  );
}
